import React, { Component } from "react";

import Name from "./Name";
import Contact from "./Contact";
import Experience from "./Experience";
import Skills from "./Skills";
import Education from "./Education";
import Awards from "./Awards";

class Form extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { name, contact, experience, skills, education, awards } =
      this.props.cv;
    const {
      setName,
      setContact,
      setExperience,
      setSkills,
      setEducation,
      setAwards,
    } = this.props.setCV;

    console.log(this.props.cv);

    return (
      <div>
        <Name name={this.props.name} />
        <Contact contact={this.props.contact} />
        <Experience experience={this.props.experience} />
        <Skills skills={this.props.skills} />
        <Education education={this.props.education} />
        <Awards awards={this.props.awards} />
      </div>
    );
  }
}

export default Form;
